<?php

class PayloadTest extends \PHPUnit\Framework\TestCase
{
    private $base64Image = '';

    public function testGetPayload()
    {
        $testPayload = (new \Eguana\QrPix\Pix\Payload())->setPixKey('wesley@agits.com.br')
            ->setDescription('Contribuição para o pacote')
            ->setMerchantName('Wesley Serafim Araujo')
            ->setMerchantCity('Rio de Janeiro')
            ->setAmount(10.00)
            ->setTransactionId('6079e46d3c45d');

        $testPayloadQrCode = $testPayload->getPayload();
        $expectResult = '00020126710014br.gov.bcb.pix0119wesley@agits.com.br0226Contribuição para o pacote520400005303986540510.005802BR5921Wesley Serafim Araujo6014Rio de Janeiro621705136079e46d3c45d6304D652';

        $this->assertEquals($expectResult, $testPayloadQrCode);

        print 'Test Get Payload of Pix';
    }

    public function testGetQrCodeImage()
    {
        $testPayload = (new \Eguana\QrPix\Pix\Payload())->setPixKey('wesley@agits.com.br')
            ->setDescription('Contribuição para o pacote')
            ->setMerchantName('Wesley Serafim Araujo')
            ->setMerchantCity('Rio de Janeiro')
            ->setAmount(10.00)
            ->setTransactionId('6079e46d3c45d');

        $image = (new \Eguana\QrPix\Pix\QrCodePix())->setObjQrCode($testPayload->getPayload())
            ->getImageQrCode(100);

        $this->assertEquals($this->base64Image, base64_encode($image));

        print 'Return image of QR Code of Pix';
    }
}